import Card from "../UI/Cards";
import MealItem from "./MealItem/MealItem";

import classes from "./AvailableMeals.module.css";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Sushi",
    description: "Ryba najwyższej jakości",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Schnitzel",
    description: "Niemiecki specjał",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Burger Barbecue",
    description: "Wołowy burger z sosem BBQ",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Zielona miska",
    description: "Świeże warzywa - samo zdrowie",
    price: 18.99,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => <MealItem key={meal.id} />);

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
